async function downloadImage(url: string, filename: string) {
  return await chrome.downloads.download({
    url: url,
    filename: filename,
    conflictAction: "overwrite",
  });
}

export function createSingleChooseOpt(from: number, to: number) {
  let result = [];

  for (; from <= to; from++) {
    let obj = {
      type: `${from}x単選項目`,
      id: `opt${from}x_tit`,
      val: ``,
      label: "タイトル",
      options: [] as any[]
    }
    result.push(obj);
    for (let i = 0; i <= 9; i++) {
      obj.options.push({
        t: {
          id: `opt${from}${i}_t`,
          val: ``,
          label: `項目_${from}${i}`
        }, p: {
          id: `opt${from}${i}_p`,
          val: 0,
          label: `単価`
        }
      });
    }
  }
  return result;
}
